import { TextField } from "@material-ui/core"

const MainInput = ({type,title}) => {
    return (
    <TextField
        id="datetime-local"
        label={title}
        type={type}
        defaultValue={(new Date(new Date().toLocaleString('en-US', { timeZone: 'Asia/Jakarta' })).toISOString()).split(":").slice(0,2).join(":")}
        InputLabelProps={{
        shrink: true,
        }}
    />
    )
}

export default MainInput
